export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <div>
      <form>
        <input value={name} />
        <input />
        <input />
      </form>
      <h2>Contact Form baby</h2>
      <p>{name}</p>
    </div>
  );
};
